The strict aliasing rules describe via which alias a value can be accessed. Informal: an alias is a reference / pointer to a value. Accessing a value through an alias that violates the strict aliasing rules is undefined behavior (UB). Examples below on godbolt . int i = 0; // Valid aliasing (signed / unsigned type).
*reinterpret_cast<signed int*>(&i);
*reinterpret_cast<unsigned int*>(&i); // Valid aliasing (cv qualified type).
*reinterpret_cast<const int*>(&i);
*reinterpret_cast<const unsigned*>(&i); // Valid aliasing (byte type).
*reinterpret_cast<char*>(&i);
*reinterpret_cast<std::byte*>(&i); // Invalid aliasing, dereferencing pointer is UB.
*reinterpret_cast<short*>(&i);
*reinterpret_cast<float*>(&i); NOTE: Casting pointer to invalid aliasing type is not directly UB, but dereferencing the pointer is UB. short s[2] = { 1, 2 }; // Invalid aliasing (UB) - type punning, UB to deref ptr (int has stricter
// alignment requirements than short).
*reinterpret_cast<int*>(s); // Arbitrary byte pointer.
char c[4] = { 1, 2, 3, 4 }; // Invalid aliasing (UB) - type punning, UB to deref ptr (int has stricter
// alignment requirements than char).
*reinterpret_cast<int*>(c); At the time of writing, the current c++ std draft contains the following. If a program attempts to access the stored value of an object through a glvalue
whose type is not **similar** (7.3.6) to one of the following types the
behavior is undefined [44] (11.1) the dynamic type of the object,
(11.2) a type that is the signed or unsigned type corresponding to the dynamic type of the object, or
(11.3) a char, unsigned char, or std::byte type. [44]: The intent of this list is to specify those circumstances in which an object can or cannot be aliased. The paragraph is short but one also needs to understand the meaning of similar ( similar_types ) . This paragraph is actually somewhat more explicit in the c++17 std . If a program attempts to access the stored value of an object through a glvalue
of other than one of the following types the behavior is undefined [63] (11.1) the dynamic type of the object,
(11.2) a cv-qualiﬁed version of the dynamic type of the object,
(11.3) a type similar (as deﬁned in 7.5) to the dynamic type of the object,
(11.4) a type that is the signed or unsigned type corresponding to the dynamic type of the object,
(11.5) a type that is the signed or unsigned type corresponding to a cv-qualiﬁed version of the dynamic type of the object,
(11.6) an aggregate or union type that includes one of the aforementioned types among its elements or non- static data members (including, recursively, an element or non-static data member of a subaggregate or contained union),
(11.7) a type that is a (possibly cv-qualiﬁed) base class type of the dynamic type of the object,
(11.8) a char, unsigned char, or std::byte type. [63]: The intent of this list is to specify those circumstances in which an object may or may not be aliased. Additional references: What is the Strict Aliasing Rule and Why do we care The article shows a small example how the compiler may optimized using the strict aliasing rules. int alias(int* i, char* c) { *i = 1; *c = 'a'; // char* may alias int* return *i;
