A forwarding reference is a special references that preserves the value category of a function parameter and therefore allows for perfect forwarding. A forwarding reference is a parameter of a function template, which is declared as rvalue reference to a non-cv qualified type template parameter. template<typename T>
void fn(T&& param); // param is a forwarding reference Perfect forwarding can be achieved with std::forward . This for example allows a wrapper function to pass a parameter with the exact same value category to a down-stream function which is being invoked in the wrapper. #include <cstdio>
#include <utility> struct M {}; // -- CONSUMER ----------------------------------------------------------------- void use(M&) { puts(__PRETTY_FUNCTION__);
} void use(M&&) { puts(__PRETTY_FUNCTION__);
} // -- TESTER ------------------------------------------------------------------- template<typename T>
void wrapper(T&& param) { // forwarding reference puts(__PRETTY_FUNCTION__); // PARAM is an lvalue, therefore this always calls use(M&). use(param);
} template<typename T>
void fwd_wrapper(T&& param) { // forwarding reference puts(__PRETTY_FUNCTION__); // PARAM is an lvalue, but std::forward returns PARAM with the same value // category as the forwarding reference takes. use(std::forward<T>(param));
} // -- MAIN --------------------------------------------------------------------- int main() { { std::puts("==> wrapper rvalue reference"); wrapper(M{}); // calls use(M&). std::puts("==> wrapper lvalue reference"); struct M m; wrapper(m); // calls use(M&). } { std::puts("==> fwd_wrapper rvalue reference"); fwd_wrapper(M{}); // calls use(M&&). std::puts("==> fwd_wrapper lvalue reference"); struct M m; fwd_wrapper(m); // calls use(M&). }
}

